    false,nt"url": null,nt"notes": "In 1988 the Missouri Department of Conservation
    (MDC) in cooperation with the U.S. Fish and Wildlife Service (USFWS) began a project
    to determine the distribution, abundance and habitat associations of bird species
    in Missouri. The following report concerns two separate objectives of the MDC and
    USFWS grant agreement: Objective 2, to determine evidence of breeding, relative
    abundance, and habitat associations of bird species on four National Wildlife Refuges
    (NWR) and 25 wild card blocks. Objective 3, to identify the breeding status, distribution,
    relative abundance, and habitat association of 10 management concern species.",nt"license_title":
